import React from 'react';
import profilepic from './profilepic.jpg';
const Profile = ()=>{
    return(
        <div>
            <div>
                <div>
                    <img style={{width:"160px", height:"160px", borderRadius:"80px"}}
                    src={profilepic}
                    />
                </div>
                <div></div>
            </div>
        </div>
    )
}

export default ProfileScreen
